import React, { useState } from 'react';
import { Typography, Button } from "@material-ui/core";






export default function Teams() {
  const hasTeam = false;


  if (!hasTeam) {
      return (
          <div>
            <Typography>Please create or join a team to see your teams information</Typography>
            <Button>Join Team</Button>
            <Button>Create Team</Button>
          </div>
      )
  }
  return (
    <div>
        <Typography>Your team's info:</Typography>
        <Button>Join Team</Button>
        <Button>Create Team</Button>
    </div>
  );
}
